import React from 'react';
import styled from 'styled-components';

const Headers:React.FC = () =>{
    return(
        <HeaderWrap>
            this is header;
        </HeaderWrap>
    );
}

const HeaderWrap = styled.div`
    background-color:#ff9Oee9O;
`;
export default Headers;
